import React, { Component } from "react";
import Signup from '../signup/Signup'
import Home from "./Home";
import Events from "./Events";
import './Main.css'
import {
    Route,
    NavLink,
    HashRouter
} from "react-router-dom";

class Main extends Component {
    render() {
        return (
            <HashRouter>
                <div className="Main">
                    <div class="img-banner">
                        <img className="img-main" src="https://images.unsplash.com/photo-1464820453369-31d2c0b651af?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1000&q=80" alt="" />
                    </div>
                    <h1 className="site-name">Culture Club</h1>
                    <ul className="header">
                        <li><NavLink exact to="/">Home</NavLink></li>
                        <li><NavLink to="/signup">Signup</NavLink></li>
                        <li><NavLink to="/events">Events</NavLink></li>
                    </ul>
                    <div className="content">
                        <Route exact path="/" component={Home} />
                        <Route path="/signup" component={Signup} />
                        <Route path="/events" component={Events} />
                    </div>
                </div>
            </HashRouter>
        );
    }
}

export default Main;
